caption:
Today we're amplifying the trans community.

International Transgender Day of Visibility is a day to show our love and support for the trans community. It is a day to celebrate their achievements and to raise awareness for the work that still needs to be done.

The transgender community has faced intense amounts of adversity and discrimination throughout history. It is important we support and commemorate them and act as allies to advocate for their rights and fight against transphobia.

Swipe for courageous and beautiful women in the trans community to follow.

@zuleykastrasner - founder and CEO of Zero Grocery, a sustainable, plastic-free grocery delivery business in California.

@mashagessen - a nonbinary and trans Russian-American journalist, author, translator, activist, and staff writer for The New Yorker. They are the recipient of many awards including the 2017 National Book Award for Nonfiction and the 2018 Hitchens Prize.

@geenarocero - model, activist, andco-founder of Gender Proud, a media company that shares trans-specific stories to invoke social justice for the transgender community.

@mjrodriguez7 - actress and singer who has a lead role in the FX series Pose, making her part of the largest cast of transgender actresses for a series. In 2021, she won the Golden Globe Award for Best Actress - Television Series Drama.

@hunterschafer - model, actress, and activist most recently known for her role in the HBO series Euphoria.

@leynabloom - actress, model, dancer, and activist who was the first transgender woman to appear on the cover of the Sports Illustrated Swimsuit Issue in July 2021.

@mskataluna - American Beauty Pageant title holder winning Miss Nevada USA in June 2021, making her the first openly transgender Miss USA contestant.

@valentts - model and actress who, in 2019, was the first openly transgender Victoria Secret model.

@lavernecox - actress and activist who is famously know for her role in Orange Is the New Black. In 2015, she was the first transgender woman to win a Daytime Emmy Award.

#transvisibilityday
